module Faker
  module GeographicHelpers
    def rand_point_within(point, radius)
      begin
        a_point = rand_point
      end while point.distance(a_point) >= radius
      a_point
    end

    def rand_point
      factory = RGeo::Geographic.spherical_factory(srid: 4326)
      long = rand(-180.000000...180.000000).round(6)
      lat = rand(-90.000000...90.000000).round(6)
      factory.point(long, lat)
    end
  end

  module ImageHelpers
    def random_base64_image
      SAMPLE_IMAGES.sample
    end

    SAMPLE_IMAGES = [ 
      "data:image/png;base64,",
      "data:image/png;base64,",
      "data:image/png;base64,",
      "data:image/png;base64,",      
    ].freeze
  end
end
